  \"2016-07-27T22:47:05.320300\",\n\t\"name\": \"narrative-report-mark-twain-national-wildlife-refuge-louisa-keithsburg-unit-september-dec-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Port Louisa National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1962. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, vegetation control, and prescribed fires.
  Resource management is outlined; topics include fur harvesting. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. N-R forms and photographs are attached.\",\n\t\"license_title\":
